The chromatic tuner metronome that features a jog dial for accurate tuning of all instruments.
&lt;ol&gt;
&lt;li&gt;Multifunctional JOG DIAL&lt;/li&gt;&lt;li&gt;Tap tempo feature
&lt;/li&gt;&lt;li&gt;LED indicators and LCD 2 colour backlit screen&lt;/li&gt;&lt;li&gt;Built-in mic and speaker&lt;/li&gt;&lt;li&gt;3.5mm earphone jack&lt;/lI&gt;&lt;/ol&gt;

Digital chromatic tuner for musical instruments
&lt;ol&gt;
&lt;/li&gt;&lt;li&gt;Automatic and manual modes&lt;/li&gt;&lt;li&gt;Built in mic and 1/4 input and output&lt;/li&gt;&lt;li&gt;LCD screen and LED indicators
&lt;/li&gt;&lt;li&gt;Adjustable reference pitch and adjusts up to four flats&lt;/li&gt;&lt;/ol&gt;

