The Piper&#039;s Pipe Case is made of lightweight plywood and covered with black vinyl on the outer surface and protective velor on the inside. There are elastic straps on the inside lid to hold music or a practice chanter. 

The measurements for the case are 11.5&quot; x 24&quot; x 5&quot; 

